import { useState } from "react"
import './1234.css'


export default function({tabsContent, onChange}){
    const[currentTab,setCurrentTab] = useState(0);
    return(
        <div className="tab-container">
            <div className="tab-top-container">
                {
                    tabsContent && tabsContent.length ?
                    tabsContent.map((tabitem)=>
                    <div className="tab-item" >
                        <span>{tabitem.label}</span>
                    </div>
                    )
                    :null
                }
            </div>
            <div className="tab-data-container">
                {
                    tabsContent[currentTab] && tabsContent[currentTab].content
                }
            </div>
        </div>
    )
}
